pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract ProjectOffice2 {

    Components[] public component;
    address public customer;

    struct Components{
    uint64 ElevatorsShafts; // 8 = 2 columns * 4 elevators
    uint64 Controllers; // 1 = 1 per battery
    uint64 Buttons; //  25 = 5floors * 5 buttons
    uint64 Doors; // 10 =1 per floor * columns
    uint64 Displays; // 8 = 1 per elevator 
    }

    constructor() public {
        customer = msg.sender;
    }

     function addOrder(uint64 _shafts,uint64 _controllers,uint64 _buttons,uint64 _doors,uint64 _displays) public returns(uint256)
    {   
        component.length++;
        component[component.length-1].ElevatorsShafts = _shafts;
        component[component.length-1].Controllers = _controllers;
        component[component.length-1].Buttons = _buttons;
        component[component.length-1].Doors = _doors;
        component[component.length-1].Displays = _displays;
        return component.length;
    }

     function componentCount() public view returns(uint){
        return component.length;
    }

    //  function get() public view returns(Components[] memory)
    // {
    //     return component;
    // }  
}
